import React from 'react'

const MealItem = (props) => {
    const price = `$${props.price.toFixed(2)}`
    return (
        <li>
            <h3>{props.name}</h3>
            <div>{props.describtion}</div>
            <div>{price}</div>
        </li>
    )
}

export default MealItem
